  false,\n\t\"url\": null,\n\t\"notes\": \"Where to buy clear gasoline in Oregon.
  \ \"Clear\" gasoline is defined as a non-ethanol blended gas, generally produced
  with 91 octane and sold asa  premium blend.  Clear gasoline is a much better fuel
  for boats, ATV's, 1990 era and earlier car models, chainsaws, and yard equipment
  because of the rubber hoses, fuel lines, gaskets, etc. that can easily deteriorate
  with the use of ethanol-blended fuel.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
